import React from "react";
import "./LandingPage.css";

const LandingPage = ({ dark }) => {
  const backgroundColor = dark ? "#121212" : "#FFFFFF";
  const primary = dark ? "#FFFFFF" : "#121212";
  return (
    <div
      className="landing-page-wrapper"
      style={{ backgroundColor: backgroundColor }}
    >
      <div style={{color: primary}} className="welcome-text">Hello, welcome to </div>
      <div style={{color: '#FF7597', fontSize: '200px'}} className="welcome-text"><h1>BaatChit</h1></div>
    </div>
  );
};

export default LandingPage;
